import logo from './logo.svg';
import './App.css';
import {BrowserRouter, Route, Routes} from "react-router-dom";
import StartScreen from "./page/StartScreen";

function App() {
  return (
    <>
      <BrowserRouter>
        <Routes>
          <Route path={"/"} element={<StartScreen/>}/>
        </Routes>
      </BrowserRouter>
    </>
  );
}

export default App;
